        contactEnvironmentAgencyLink.click();
        browser.pause(2000);
        expect(browser).toHaveUrl('https://www.gov.uk/contact');
        expect(browser).toHaveTitle("Find contact details for services - GOV.UK");
        browser.pause(5000);
        browser.back();
		//browser.pause(90000);

      });





});

